import React from "react";

const points = [
  {
    missingPoints: "Can't find your activity points?",
    reportmissingItems: "Report missing activity points",
  },
  {
    filterDate: "All of September 2020",
  },
];

const Activitypoints = ({ points }) => {
  return (
    <>
      <ul>
        {points.map((values) => (
          <li>
            <p>
              {values.missingPoints} {values.reportmissingItems}
              {values.filterDate}
            </p>
          </li>
        ))}
        {users.map((user) => (
          <li key={user.name}>{user.name}</li>
        ))}
      </ul>
    </>
  );
};

export default Activitypoints;
